import React from 'react';
import { Link } from 'react-router-dom'; // Assuming routing is set up later

const Home = () => {
  return (
    <div className="home">
      {/* Hero Section */}
      <section className="hero">
        <div className="hero-content">
          <h1>EmpowerHer</h1>
          <p>Empowering Women Through Skills, Mentorship, and Community Support</p>
          <div className="hero-buttons">
            <Link to="/register" className="btn btn-primary">Get Started</Link>
            <Link to="/login" className="btn btn-secondary">Login</Link>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section className="features">
        <h2>Our Features</h2>
        <div className="features-grid">
          <div className="feature-card">
            <h3>Mentorship</h3>
            <p>Connect with experienced mentors to guide your career journey.</p>
          </div>
          <div className="feature-card">
            <h3>Learning</h3>
            <p>Access courses and resources to develop new skills.</p>
          </div>
          <div className="feature-card">
            <h3>Community Forum</h3>
            <p>Engage with a supportive community of women.</p>
          </div>
          <div className="feature-card">
            <h3>Events</h3>
            <p>Join workshops, webinars, and networking events.</p>
          </div>
        </div>
      </section>

      {/* About Section */}
      <section className="about">
        <h2>About EmpowerHer</h2>
        <p>EmpowerHer is a comprehensive platform designed to empower women by providing access to mentorship, educational resources, community support, and professional development opportunities. Join us in building a stronger, more connected community of empowered women.</p>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>&copy; 2023 EmpowerHer. All rights reserved.</p>
      </footer>

      <style jsx>{`
        .home {
          font-family: Arial, sans-serif;
          line-height: 1.6;
          color: #333;
        }

        .hero {
          background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
          color: white;
          padding: 100px 20px;
          text-align: center;
        }

        .hero h1 {
          font-size: 3rem;
          margin-bottom: 20px;
        }

        .hero p {
          font-size: 1.2rem;
          margin-bottom: 30px;
        }

        .hero-buttons {
          display: flex;
          justify-content: center;
          gap: 20px;
        }

        .btn {
          padding: 12px 24px;
          text-decoration: none;
          border-radius: 5px;
          font-weight: bold;
          transition: background-color 0.3s;
        }

        .btn-primary {
          background-color: #ff6b6b;
          color: white;
        }

        .btn-primary:hover {
          background-color: #ff5252;
        }

        .btn-secondary {
          background-color: transparent;
          color: white;
          border: 2px solid white;
        }

        .btn-secondary:hover {
          background-color: white;
          color: #667eea;
        }

        .features {
          padding: 80px 20px;
          background-color: #f8f9fa;
          text-align: center;
        }

        .features h2 {
          font-size: 2.5rem;
          margin-bottom: 50px;
        }

        .features-grid {
          display: grid;
          grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
          gap: 30px;
          max-width: 1200px;
          margin: 0 auto;
        }

        .feature-card {
          background: white;
          padding: 30px;
          border-radius: 10px;
          box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }

        .feature-card h3 {
          color: #667eea;
          margin-bottom: 15px;
        }

        .about {
          padding: 80px 20px;
          text-align: center;
          max-width: 800px;
          margin: 0 auto;
        }

        .about h2 {
          font-size: 2.5rem;
          margin-bottom: 30px;
          color: #667eea;
        }

        .footer {
          background-color: #333;
          color: white;
          text-align: center;
          padding: 20px;
        }
      `}</style>
    </div>
  );
};

export default Home;
